import React, {Component} from 'react';
import '../../App.css';
//import axios from 'axios';
//import cookie from 'react-cookies';
//import {Redirect} from 'react-router';

class BuyerSignup extends Component {


    render(){

        return(
            <div>
                <div class="container">
                <div class="login-form">
                    <div class="main-div">
                        <div class="panel">

                        </div>

                            <div class="form-group">

                                <div className="col-md-4"></div>
                                <div className="col-md-4  outer-box">
                                <div className="col-md-12">   
                                <h3>Sign in with your Grubhub account</h3>
                                </div>
                                    <div class="form-group" className="col-md-12">
                                    Email<br/>
                                    <input type="email" class="form-control" name="email" required />
                                    </div>
                                    <div class="form-group" className="col-md-12">
                                    Password<br/>
                                    <input type="password" class="form-control" name="password" required />
                                    </div>
                                    <div class="form-group" className="col-md-12">
                                    <span>
                                    <br/>
                                    <input type="checkbox" id="chkbox" name="chkbox"/> Keep me signed in</span><br/>
                                    <br/>
                                    <button class="btn btn-primary col-md-12 login-button">Sign In</button>
                                    </div>
                                </div>   
                                <div className="col-md-4"></div>  
                            </div>           
                        </div>
                </div>
            </div>
            </div>
        )
    }
}

export default BuyerSignup;
